export const getVideoLinks = (videos = [], id) => {
  let creatorVideos = [];
  videos.forEach((item) => {
    if (item.yt_channel_id === id) creatorVideos.push(item);
  });

  return creatorVideos;
};

export const getVideoLink = (id) => {
  return 'https://www.youtube.com/watch?v=' + id;
};
